    /* Estilo do modal */
    .modal {
      background-color: #c2c6cb;
      border: white 2px solid;
      padding: 40px;

      right: 10px;
      background: transparent;
      border: none;
      font-size: 1.5em;
      color: #333;
      cursor: pointer;
    }

      margin: 0 0 10px;
      font-size: 1.75rem;

      font-size: 1em;
      margin-bottom: 20px;

      margin-top: 5px;

      color: white;
      border: none;
      border-radius: 5px;

      font-size: 1em;
      text-decoration: none;
      padding: 9px 15px 10px 15px;

    .button:hover,
    .afiliate-link-cose:hover {
      background: #c2c6cb;
    }

    .afiliate-link-close {
        margin-top: 5px;
        background: #c2c6cb;
        color: #0011ff;
        border: .8px solid #0011ff;
        border-radius: 5px;
        cursor: pointer;
        font-size: 1em;
        text-decoration: none;
        padding: 9px 15px 10px 15px;
    }

    .button:hover,
    .afiliate-link-close:hover {
      background: #c2c6cb;
    }

    .buttons{
      display: flex;
      gap: .6rem;
